var tipuesearch = {"pages":[{"text":"2016Fall 修課成員網誌","title":"About","url":"./pages/about/","tags":"misc"},{"text":"cdt Week1 第一週 登入既有的Github倉儲,並Fork(https://github.com/mdecourse/2016fallcadp) 建立 2016fallcadp_hw 倉儲, 將分支設為 gh-pages 再建立一個名稱為(帳號).github.io的倉儲, 並在裡面建立 index.html 就可以用 https://帳號.github.io 連結到 index.html 自選組員, 確定各組組長學號, 組長再設為[課程倉儲] (https://github.com/mdecourse/2016fallcadp) 的協同者, 負責協助管理這個倉儲, 並管理組員對倉儲的 pull requests","title":"2016Fall Week1","url":"./2016fall-week1.html","tags":"Misc"},{"text":"fgh","title":"2016Fall Week10","url":"./2016fall-week10.html","tags":"Misc"},{"text":"zxc","title":"2016Fall Week11","url":"./2016fall-week11.html","tags":"Misc"},{"text":"uio","title":"2016Fall Week12","url":"./2016fall-week12.html","tags":"Misc"},{"text":"","title":"2016Fall Week13","url":"./2016fall-week13.html","tags":"Misc"},{"text":"gh-pages Week2 第二週 如何使用ShareX來錄製影片還有截圖 先去ShareX官方網站下載軟體 選軟體的Task settings裡的Screen recorder,再選Screen recording設定錄影畫面及錄音型式 到軟體的Application settings中的path來設定存檔內容 按Shift+Print Scrn可以選擇錄影範圍 再按下Shift+Print Scrn可以停止錄影","title":"2016Fall Week2","url":"./2016fall-week2.html","tags":"Misc"},{"text":"NG","title":"2016Fall Week3","url":"./2016fall-week3.html","tags":"Misc"},{"text":"111","title":"2016Fall Week4","url":"./2016fall-week4.html","tags":"Misc"},{"text":"ddf","title":"2016Fall Week5","url":"./2016fall-week5.html","tags":"Misc"},{"text":"tye","title":"2016Fall Week6","url":"./2016fall-week6.html","tags":"Misc"},{"text":"qwe","title":"2016Fall Week7","url":"./2016fall-week7.html","tags":"Misc"},{"text":"asd","title":"2016Fall Week8","url":"./2016fall-week8.html","tags":"Misc"},{"text":"rty","title":"2016Fall Week9","url":"./2016fall-week9.html","tags":"Misc"}]};